import React from "react";

const styles = {
    backgroundColor: "blue",
    margin: "auto",
    paddingTop: "1%",
    textAlign: "center",
}

function Todo(){
    return(
        <div style = {styles}>
            <h1>this is the nav object</h1>
        </div>
    );
}

export default Todo;
